// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LandingPage from './zippy/LandingPage';
import DrawingGridPage from './zippy/DrawingGridPage';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './css/custom.css'; // Import custom CSS here
import './fontawesome/all.min.css';
import './fontawesome/brands.min.css';
import './fontawesome/duotone.min.css';
import './fontawesome/fontawesome.min.css';
import './fontawesome/light.min.css';
import './fontawesome/regular.min.css';
import './fontawesome/sharp-duotone-solid.min.css';
import './fontawesome/sharp-light.min.css';
import './fontawesome/sharp-regular.min.css';
import './fontawesome/sharp-solid.min.css';
import './fontawesome/sharp-thin.min.css';
import './fontawesome/solid.min.css';
import './fontawesome/svg-with-js.min.css';
import './fontawesome/thin.min.css';
import './fontawesome/v4-font-face.min.css';
import './fontawesome/v4-shims.min.css';
import './fontawesome/v5-font-face.min.css';


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/draw" element={<DrawingGridPage />} />
      </Routes>
    </Router>
  );
}

export default App;
